import React, { useState } from "react";
import styled from "styled-components";
import ProgressBar from "./ProgressBar";
import CalcOne from "./CalcOne";
import Submit from "./Submit";
import Hiking from "./hiking";
import handleCalculation from "./CalcOne";

const AppContainer = styled.div`
  display: flex;
  height: 100vh;
`;

const HikingContainer = styled.div`
  flex: 1;
  background-image: url("/path_to_hiking_image.jpg");
  background-repeat: no-repeat;
  background-size: cover;
`;

const ContentContainer = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
`;

function App() {
  const [completed, setCompleted] = useState(60); // Set the initial completed value here

  return (
    <AppContainer>
      <HikingContainer />
      <ContentContainer>
        <ProgressBar bgcolor="#6a1b9a" completed={completed} />
        <CalcOne />
        <Submit />
      </ContentContainer>
    </AppContainer>
  );
}

export default App;
